import React from "react";

import ItemCardList from "../components/ItemCardList";

const Home = () => {
    return(
        <main class="m-5">
                <div class="row mt-3 mb-4 text-center text-dark">
                    <div class="col-12">
                        <h2>¡Bienvenido a GameForum!</h2>
                        <p>Una web para buscar algo nuevo, y una red social para conversar con tus amigos</p>
                    </div>
                </div>

                <ItemCardList title="Últimos lanzamientos"/>
                <ItemCardList title="Más populares en música"/>
                <ItemCardList title="Más populares en juegos"/>
                <ItemCardList title="Más populares en películas"/>
                <ItemCardList title="Más populares en series de TV"/>
                <ItemCardList title="Más populares en libros"/>
        </main>
    );
};

export default Home;
